import Header from './components/HeaderBlock';
import Layout from './components/LayoutBlock/index.js';

import './App.css';

import { ReactComponent as bg3 } from '../../assets/';

const App = () => {
  return (
    <>
    <Header title = 'tit' descr='ded'/>
    <Layout title descr urlBg colorBg />
    <Layout title descr urlBg colorBg />
    <Layout title descr urlBg colorBg/>
    <Footer />
    </>
    );
}

export default App;
